import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';

const Signflow = () => {
  // State for username and password
  const [user, setUser] = useState({ username: "", password: "" });
  // State for error message
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Get the username from the previous page
    const previousUsername = sessionStorage.getItem("username");
    // Check if the entered password matches the username from the previous page
    if (user.password === previousUsername) {
      // Redirect to "/home" if the password matches
      window.location.href = "/home";
    } else {
      // Show error message if the password doesn't match
      setError("Invalid password");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in">
        <a href="/public">
          <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
        </a>
        <div className="nav_1">
          <div className="for-x">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
        </div>
        <div className="down-box">
          <div className="content">
            <h2>Enter Your Password</h2>
            <div className="lin_main">
              <div className="lin"></div><div className="text">or</div><div className="lin"></div>
            </div>
            <input
              className="input"
              type="text"
              name="username"
              value={user.username}
              onChange={handleChange}
              placeholder="Phone, email, or username"
              disabled
            />
            <input
              className="input"
              type="password"
              name="password"
              value={user.password}
              onChange={handleChange}
              placeholder="Password"
            />
            <button type="submit" className="box_ nex">Next</button>
            {error && <div className="error">{error}</div>}
            <div className="box_">Forgot password?</div>
            <div className="text">Don't have an account? <a href="/create">Sign Up</a></div>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
}

export default Signflow;
